import Chart from "../Chart/Chart"

const ExpensesChart = props=>{
    let chartDataPoints=[
        {month:'Jan' , value:0},
        {month:'Feb' , value:0},
        {month:'Mar' , value:0},
        {month:'Apr' , value:0},
        {month:'May' , value:0},
        {month:'Jun' , value:0},
        {month:'Jul' , value:0},
        {month:Aug , value:0},
        {month:Sep , value:0},
        {month:Oct , value:0},
        {month:Nov , value:0},
        {month:Dec , value:0}
    ];
    
    props.expenses.forEach(expense => {
        const expenseMonth=expense.month.getMonth();
        chartDataPoints[expenseMonth]+=expense.amount
    });

    return <Chart dataPoints={chartDataPoints}/>
}

export default ExpensesChart;
